import React from 'react';
import './tshirts.css';
import shirt1 from './images/cloths.avif'

const Tshirts = () => {
  return (
    <section id='tshirtsection'>
        <div>
            <div> <img src={shirt1}/>
                   <h1>Price: 899</h1></div>
        </div>


    </section>
  )
}

export default Tshirts
